import React from 'react';
import styled from 'styled-components';

const NavContainer = styled.ul`
    background-color: #33a;
    width: 100%;
    height: 560px;
    & > li {
        color: #fff;
        height: 80px;
        position: relative;
        display: flex;
        justify-content: center;
        &:hover {
            cursor: pointer;
            background-color: #55a;
            &::after {
                content: '';
                position: absolute;
                border-style: solid;
                border-width: 20px 0 20px 20px;
                border-color: transparent #55a;
                display: block;
                width: 0;
                z-index: 1;
                top: 20px;
                right: -15px;
            }
        }
        &:not(:last-child) {
            border-bottom: 1px solid #aaf;
        }
    }
`;

const Label = styled.span`
    color: #fff;
    font-size: 20px;
`;

const AdminNav = () => {
    return (
        <NavContainer>
            <li><Label>스터디 관리</Label></li>
            <li></li>
            <li></li>
            <li></li>
            <li></li>
            <li></li>
            <li></li>
        </NavContainer>
    );
};

export default AdminNav;
